function loadItems(n,t){pageFlag||_inCallback||(_inCallback=!0,page++,$.ajax({type:"POST",url:n,data:{TagName:tag,Page:page},dataType:"html",success:function(n){n!==""?$(t).append(n):pageFlag=!0;_inCallback=!1}}))}function deleteItem(n,t,i){$.ajax({type:"DELETE",url:n,data:{id:i},dataType:"text",success:function(n,i){i==="success"&&$(t).remove()}})}let tag=$("#name-tag").val(),page=-1,_inCallback=!1,pageFlag=!1;loadItems("/Tag/ItemPage/","#tableBody");$(window).scroll(function(){Math.trunc($(window).scrollTop())===$(document).height()-$(window).height()&&loadItems("/Tag/ItemPage/","#tableBody")});